mapper.select:

select 

from ATMTROUTDATA
where TXDATE = #{txdate,jdbcType=VARCHAR}
  and HOUR = #{hour,jdbcType=VARCHAR}
  and NUM = #{num,jdbcType=INTEGER}

mapper.delete:

delete from ATMTROUTDATA
where TXDATE = #{txdate,jdbcType=VARCHAR}
  and HOUR = #{hour,jdbcType=VARCHAR}
  and NUM = #{num,jdbcType=INTEGER}

